objetoCompra:
Instalação de Toldos para 2 Vagas de Garagem do Hotel de Trânsito
Os serviços compreendem a confecção, montagem e instalação de toldos destinados à cobertura de duas vagas de garagem do Hotel de Trânsito, incluindo:
Instalação de estrutura metálica adequada ao suporte dos toldos;
Colocação de lonas, placas ou materiais equivalentes;
Substituição de lonas por placas de policarbonato, quando necessário;
Instalação de coberturas em policarbonato (compacto ou alveolar);

